import React from "react";
import "../../Assets/Fonts/StarWarsFont.css";

const HeaderComponent: React.FC = () => {
    return <div className="container-fluid">
        <div className="border-bottom border-warning border-2">
            <nav className="nav d-flex justify-content-between">
                <div style={{marginBottom: "2px"}} className="custom-font">STEvEN serrao</div>
                <a className="nav-link active" href="https://www.instagram.com/steven_serrao" target="_blank"><i className="bi bi-instagram"></i></a>
                <a style={{marginBottom: "30px"}} className="custom-font">My Cv</a>
            </nav>
        </div>
    </div>
}

export default HeaderComponent;
